const createIteratorObject = (reportObject) => {
    const { allEmployees } = reportObject;

    // Define the iterator
    return {
        [Symbol.iterator]: function* () {
            for (const department of Object.values(allEmployees)) {
                for (const employee of department) {
                    yield employee;
                }
            }
        }
    };
};

